import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './OnBoarding.css';

function OnBoarding() {
  const [screen, setScreen] = useState(1);

  const nextScreen = () => {
    setScreen(screen => (screen === 4 ? 1 : screen + 1));
  };

  const renderScreen = () => {
    switch (screen) {
      case 1:
        return (
          <div>
            <h1>Screen 1</h1>
            <p>This is the content of the first screen.</p>
            {/* Add more content specific to Screen 1 here */}
          </div>
        );
      case 2:
        return (
          <div>
            <h1>Screen 2</h1>
            <p>This is the content of the second screen.</p>
            {/* Add more content specific to Screen 2 here */}
          </div>
        );
      case 3:
        return (
          <div>
            <h1>Screen 3</h1>
            <p>This is the content of the third screen.</p>
            {/* Add more content specific to Screen 3 here */}
          </div>
        );
      case 4:
        return (
          <div>
            <h1>Screen 4</h1>
            <p>This is the content of the fourth screen.</p>
            {/* Add more content specific to Screen 4 here */}
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="onboarding">
      {renderScreen()}
      <button onClick={nextScreen}>Go to Next Screen</button>
      <img src="Assets/blackFullLogo.png" alt="Superpower Logo" />
    </div>
  );
}

export default OnBoarding;
